import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import { Nav, Navbar } from "react-bootstrap";


export const Footer = () => {
    return (

        <Navbar expand='lg' variant='dark' bg='dark' sticky='bottom' id='footer'>
            <Nav className='ml-auto mr-auto'>
                <Container>
                    <Row>
                        <Col>
                            <Navbar.Text><p className="lightBlue">615-310-7665 | devco2011@gmail.com | </p></Navbar.Text>
                        </Col>
                        <Navbar.Text id='copyright'>
                            <p className="lightBlue"> &copy; {new Date().getFullYear()} Devon Cox</p>
                        </Navbar.Text>
                    </Row>
                </Container>
            </Nav>
        </Navbar>

    )
}
